import { StyleSheet } from 'react-native';

import { FONTS } from '../../../utils';

const styles = StyleSheet.create({
  container: {
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  itemContainer: {
    justifyContent: 'center',
    alignItems: 'center',
    width: '33%',
  },
  image: {
    resizeMode: 'contain',
    width: 90,
  },
  text: {},
});

export default styles;
